import React from 'react'
import {
  FaMapMarkerAlt,
  FaCalendarDay,
  FaMale,
  FaPlus,
  FaTrash,
} from 'react-icons/fa'
import { parseUrl } from 'query-string'

import {
  EmptyInfoMessage,
  GoBackToSearchButton,
  ResultsPageContainer,
  SearchInfoContainer,
} from './styles'

export const ResultsPage: React.FC = () => {
  const queryParams = parseUrl(window.location.search)
  console.log('ðŸš€ ~ file: index.tsx ~ line 38 ~ queryParams', queryParams)

  const origin = queryParams.query.origin?.toString() || '',
    destination = queryParams.query.destination?.toString() || '',
    date = queryParams.query.date?.toString() || '',
    passengers = Number(queryParams.query.passengers) || 0

  if (!origin || !destination || !date || !passengers) {
    return (
      <ResultsPageContainer>
        <SearchInfoContainer>
          <EmptyInfoMessage>
            Looks like we don't have the information necessary for the
            calculation.
          </EmptyInfoMessage>
          <GoBackToSearchButton>Go Back to search</GoBackToSearchButton>
        </SearchInfoContainer>
      </ResultsPageContainer>
    )
  }

  return (
    <ResultsPageContainer>
      <SearchInfoContainer></SearchInfoContainer>
    </ResultsPageContainer>
  )
}
